import React, { useContext } from 'react';
import { Container, Table } from 'react-bootstrap';
import { AppContext } from '../App';

const Purchase = () => {
  const { purchases } = useContext(AppContext);

  return (
    <Container className="mt-5">
      <h2>Purchase</h2>
      <Table striped bordered hover>
        <thead>
          <tr>
            <th>Date</th>
            <th>8mm</th>
            <th>10mm</th>
            <th>12mm</th>
            <th>14mm</th>
            <th>16mm</th>
            <th>20mm</th>
            <th>24mm</th>
            <th>32mm</th>
          </tr>
        </thead>
        <tbody>
          {purchases.map((purchase) => (
            <tr key={purchase.id}>
              <td>{purchase.date}</td>
              {Object.keys(purchase.quantities).map((size) => (
                <td key={size}>{purchase.quantities[size]}</td>
              ))}
            </tr>
          ))}
        </tbody>
      </Table>
    </Container>
  );
};

export default Purchase;
